import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root',
})
export class AnimesService {
  constructor(private http: HttpClient) {}

  getAnimes() {
    return this.http.get("https://kitsu.io/api/edge/trending/anime?limit=6")
